import React, { Component, useState } from 'react'
import './MainPage.css'
import chat_bubble from './chat_bubble'
import check_box from './check_box';
import MyProfile from './MyProfile';
import GameWaiting from './GameWaiting';
import LeaderBoard from './LeaderBoard';

export default function MainPage() {
	const [curPage, setCurPage] = useState('my_profile');

	const renderPage = () => {
		switch (curPage) {
			case 'my_profile':
				return <MyProfile/>;
			case 'game_waiting':
				return <GameWaiting/>;
			case 'leaderboard':
				return <LeaderBoard/>;
		}
	};
	const [curSide, setCurSide] = useState('friends_list');
	let friendsButtonClass = 'clicked-button';
	let channelsButtonClass = 'default-button';
	const renderSide = () => {
		switch (curSide) {
			case 'friends_list':
				friendsButtonClass = 'clicked-button';
				channelsButtonClass = 'default-button';
				return ;
			case 'channels_list':
				friendsButtonClass = 'default-button';
				channelsButtonClass = 'clicked-button';
				return ; 
		}
	}
		return (
			<div className='background'>
				<div className="drawer drawer-end">
					<input id="my-drawer-4" type="checkbox" className="drawer-toggle" />
					<div className="drawer-content">
						<section className='btn-container'>
							<button className="btn btn-outline btn-success" onClick={() => setCurPage('game_waiting')}>GAME START</button>
							<button className="btn btn-outline btn-warning" onClick={() => setCurPage('my_profile')}>MY PROFILE</button>
							<button className="btn btn-outline btn-error" onClick={() => setCurPage('leaderboard')}>LEADERBOARD</button>
						</section>
						<section className='chat-container'>
							<div className='chat-box'>
								<ul>
									<li><chat_bubble/></li>
									<li>daecho : hi</li>
								</ul>
								<div>
											<div className="chat chat-start">
												<div className="chat-image avatar">
													<div className="w-10 rounded-full">
														<img src="./images/profile.jpeg" />
													</div>
												</div>
												<div className="chat-header">Obi-Wan Kenobi <time className="text-xs opacity-50">12:45</time></div>
												<div className="chat-bubble">You were the Chosen One!</div>
												<div className="chat-footer opacity-50">Delivered</div>
											</div>
											<div className="chat chat-end">
												<div className="chat-image avatar">
													<div className="w-10 rounded-full">
														<img src="./images/profile.jpeg" />
													</div>
												</div>
												<div className="chat-header">Anakin
													<time className="text-xs opacity-50">12:46</time>
												</div>
												<div className="chat-bubble">I hate you!</div>
												<div className="chat-footer opacity-50">Seen at 12:46</div>
											</div>
								</div>
							</div>
							<div>
								<input type="text" placeholder="Ï±ÑÌåÖÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî." className="input input-bordered input-accent w-full max-w-xs" />
								<button className="btn btn-active btn-primary">‚Üµ</button>
							</div>
						</section>
						<section className='swap-container'>
							{renderPage()}
						</section>
						<label htmlFor="my-drawer-4" className="drawer-button btn btn-primary">COMM<br></br>‚óÄÔ∏é</label>
					</div> 
					<div className="drawer-side">
						<label htmlFor="my-drawer-4" className="drawer-overlay"></label>
						<ul className="menu p-4 w-80 h-full bg-base-200 text-base-content">
							<div className='button-side'><button className='friend-btn'>FRIEND</button><button className='channel-btn'>CHANNEL</button></div>
							<li><a className='chat_btn'><div>daechoi's chat</div><div>üîí</div><div className="chat_memeber_count">10/25</div></a></li>
							<li><a className='chat_btn'><div>endisnl's chat</div><div>üîì</div><div className="chat_memeber_count">8/25</div></a></li>
							<li><a className='chat_btn'><div>endisnl's chat</div><div>üîê</div><div className="chat_memeber_count">8/25</div></a></li>
						</ul>
					</div>
				</div>
			</div>
	);
}
